import React from "react";
import "./Modal.css";

export default function Modal() {
  let inputValue = "";
  return (
    <React.Fragment>
      <div className="Modal">
        <h2>Change Profile Image</h2>
        <input
        onChange={e => {
          inputValue = e.target.value;
        }}
        type="text" placeholder="Image URL" />
      </div>
    </React.Fragment>
  );
}
